import { NavLink } from "react-router-dom";

function NavBar() {

  return (
    <div>
      <nav class="flex items-center justify-between flex-wrap bg-teal-500 p-6">
          <div class="flex items-center flex-shrink-0 text-white mr-6">
            <span class="font-semibold text-xl tracking-tight">WenFren</span>
          </div>
        <div class="w-full block flex-grow lg:flex lg:items-center lg:w-auto">
           <div class="text-sm lg:flex-grow">

              {/* <NavLink to="/home">Home</NavLink> */}
              <NavLink class="block mt-4 lg:inline-block lg:mt-0 text-teal-200 hover:text-white mr-4" to="/friends"> Friends</NavLink>
              {/* <NavLink to="/about"> About</NavLink> */}
              {/* <NavLink to="/login"> Login</NavLink> */}
              <NavLink class="block mt-4 lg:inline-block lg:mt-0 text-teal-200 hover:text-white mr-4" to="/meetings"> Meetings</NavLink>
              <NavLink class="block mt-4 lg:inline-block lg:mt-0 text-teal-200 hover:text-white mr-4" to="/activities"> Activities</NavLink>
              {/* <NavLink to="/noaccess"> NoAccess</NavLink> */}
              </div>
              </div>
      </nav>
  </div>
  )
}

export default NavBar;


